import axios from 'axios';

const url = "https://specifications.vinaudit.com/v3/selections?key=9NSOAST0U19Z4HH&list=";

export function getVehicleMakes(year) {
    return dispatch => {
        axios.get(url + `make&year=${year}&format=json`).then(res => {
            dispatch({
                type: 'GET_VEHICLE_MAKES',
                makes: res.data.selections
            })
        }).catch(err => {
            console.log(err)
        })
    }
}


export default function reducer(makes = [], action) {
    switch(action.type) {
        case "GET_VEHICLE_MAKES":
            return action.makes
        default: 
            return makes
    }
}
